/**
 * Request configuration for UniFFI (wrapper around core Request)
 */
public struct RequestConfig {
    public var credentialType: Credential
    public var signal: String
    public var faceAuth: Bool?

    // Default memberwise initializers are never public by default, so we
    // declare one manually.
    public init(credentialType: Credential, signal: String, faceAuth: Bool?) {
        self.credentialType = credentialType
        self.signal = signal
        self.faceAuth = faceAuth
    }
}



extension RequestConfig: Equatable, Hashable {
    public static func ==(lhs: RequestConfig, rhs: RequestConfig) -> Bool {
        if lhs.credentialType != rhs.credentialType {
            return false
        }
        if lhs.signal != rhs.signal {
            return false
        }
        if lhs.faceAuth != rhs.faceAuth {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(credentialType)
        hasher.combine(signal)
        hasher.combine(faceAuth)
    }
}


